import React from "react";
import { useNavigate } from "react-router";

import './css/styles.css';

import Card from "react-bootstrap/Card";
import { Container, Row, Col } from "react-bootstrap";

export default function Dashboard() {

    const navigate = useNavigate();

    const handleClickCreate = () => {
        navigate("/create");
    }

    const handleClickLookup = () => {
        navigate("/lookup");
    }



    return (
        <Container>

            <div className="dashboard">
                <h3>Hello! How can we help?</h3>
                <h4>You can create a new ticket, or look up an existing ticket using your email.</h4>
                <br />

                <Row>
                    <Col>
                        <Card>
                        <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-ticket-detailed" viewBox="0 0 16 16">
  <path d="M4 5.5a.5.5 0 0 1 .5-.5h7a.5.5 0 0 1 0 1h-7a.5.5 0 0 1-.5-.5Zm0 5a.5.5 0 0 1 .5-.5h7a.5.5 0 0 1 0 1h-7a.5.5 0 0 1-.5-.5ZM5 7a1 1 0 0 0 0 2h6a1 1 0 1 0 0-2H5Z"/>
  <path d="M0 4.5A1.5 1.5 0 0 1 1.5 3h13A1.5 1.5 0 0 1 16 4.5V6a.5.5 0 0 1-.5.5 1.5 1.5 0 0 0 0 3 .5.5 0 0 1 .5.5v1.5a1.5 1.5 0 0 1-1.5 1.5h-13A1.5 1.5 0 0 1 0 11.5V10a.5.5 0 0 1 .5-.5 1.5 1.5 0 1 0 0-3A.5.5 0 0 1 0 6V4.5ZM1.5 4a.5.5 0 0 0-.5.5v1.05a2.5 2.5 0 0 1 0 4.9v1.05a.5.5 0 0 0 .5.5h13a.5.5 0 0 0 .5-.5v-1.05a2.5 2.5 0 0 1 0-4.9V4.5a.5.5 0 0 0-.5-.5h-13Z"/>
</svg>
                            <Card.Body>
                                <button className="btn btn-primary" onClick={handleClickCreate}>Create Ticket</button>
                            </Card.Body>
                        </Card>
                    </Col>

                    <Col>
                        <Card>
                            <Card.Img variant="top">
                            </Card.Img>
                            <Card.Body>
                                <button className="btn btn-secondary" onClick={handleClickLookup}>Lookup Ticket</button>
                            </Card.Body>
                        </Card>
                    </Col>
                </Row>



            </div>

        </Container>

    );

}
